import MenuItem from "./Menuitem";
const menuItems = ["Home", "Recent winners", "How to Play", "FAQs"];
function Menu() {
    return (
        <div className="menu">
            {menuItems.map((item, index) => {
                return (
                    <MenuItem key={index} item={item} />
                )
            })}

        </div>
    );
}

export default Menu;
